SELECT ?procedure
WHERE {
  ?patient Encounter {
    ?patient Patient .
    ?encounter Encounter {
      ?encounter patient ?patient .
      ?encounter condition {
        ?condition Condition {
          ?condition code "M00" .
        }
      }
    }
    ?encounter procedure {
      ?procedure procedure .
      ORDER BY DESC(?procedure/basecost)
      LIMIT 1
    }
  }
}
